import React from 'react'

class FormSym extends React.Component {
    render() {
        return (
            <div>
                <main>
                    <h1 style={{textAlign: 'center'}}>Symptom Checklist Parent (Vanderbilt Modified Form)</h1>
                    <p>Please rate each symptom by circling the number that best describes the symptoms or severity of challenge.</p>
                    <h2></h2>
                </main>
            </div>
        );
    }
}



export default FormSym;
